package com.janbask.relationalOperators;

public class Relational_Operators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		int k=20;
		int l=15;
		int p =20;
		
		System.out.println(k>l);
		System.out.println(k<l);
		System.out.println(k>=l);
		System.out.println(k>=p);
		System.out.println(k<=l);
		System.out.println(k<=p);
		System.out.println(k!=l);
		System.out.println(k!=p);

	}

}
